import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Profile() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Make the API request to get the user data
    Axios.get('http://127.0.0.1:8000/api/current_user/')
      .then((response) => {
        setUser(response.data);
      })
      .catch((error) => {
        console.error('Error fetching user data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleverse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav
              className="me-auto my-2 my-lg-0"
              style={{ maxHeight: '100px' }}
              vehicleverse
            >
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
                <NavDropdown.Item href="http://localhost:3000">ADD For Sell</NavDropdown.Item>
                <NavDropdown.Item href="http://localhost:3000">ADD For Rent</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="http://localhost:3000/profile">Profile</Nav.Link>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Container className="mt-4">
        <h1 className="text-center">User Profile</h1>
        <Card className="mb-4">
          <Card.Body>
            <Card.Title>User Information</Card.Title>
            {user && (
              <div>
                <Card.Text>ID: {user.id}</Card.Text>
                <Card.Text>Username: {user.username}</Card.Text>
                <Card.Text>Email: {user.email}</Card.Text>
                <Card.Text>First Name: {user.first_name}</Card.Text>
                <Card.Text>Last Name: {user.last_name}</Card.Text>
                <Card.Text>Phone Number: {user.phone_number}</Card.Text>
                <Card.Text>Date Joined: {user.date_joined}</Card.Text>
                <Card.Text>Address: {user.address}</Card.Text>
              </div>
            )}
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
}

export default Profile;
